import React from 'react';
import './checkoutSelector.css';
import { CustomButton } from '../../components/customButton/customButton';

export const CheckoutSelector = () => { 
  return (
    <div className="checkout-wrapper">
        Total
        <CustomButton 
            border="none"
            bgColor="#F0A023"
            color="#FFFFFF"
            fontSize="16px"
            fontWeight="500"
            height = "38px"
            onClick={() => alert("You clicked on me")}
            radius = "19px"
            width = "125px"
            children = "Add receipt"
        />
  </div>
  );
};
